INSERT INTO `faq` (`id`, `question`, `ans`) VALUES
(2, 'Is it possible to change the contact number I use?', 'We\'re sorry, but we can\'t do that since you can use your mobile number to log into the app. However, if your number gets lost, changed, or misplaced, please get in touch with support@the10score.in.'),
(3, 'Is it possible to change my Email Id?', 'Oops, that\'s forbidden! Your email address is where we communicate with you. The email address that you share when creating an account cannot be altered once it is registered. We will verify your correct email address as we advance, making sure you do not make a mistake while typing it.'),
(4, 'What do I do next after I have forgotten my User ID?', 'We know that this is a hectic time, so your User ID should not have to be one of those many things on your mind. If you want it back now, we recommend following these steps: Open The 10Score App. You can log in using your phone number registered with your account. The username is displayed on your profile page.'),
(5, 'Can I change my address?', 'The answer is yes! We do not take your address details into account as of now; however, your email. The address can be used as an option for verification. Don\'t hesitate to contact us at support@the10score.com if you would like to update your address proof.'),
(6, 'Why can I not join any league with my real money on The 10Score? (Cash earned through coin contests)', 'Please note that you will be able to withdraw the real amount only. Users cannot circulate money in The 10Score application, so you can not join contests with real money. We host challenging coin contests that you can master with your skill.'),
(7, 'I did not receive my OTP. What should I do?', 'You don\'t have to worry! All registration requests are handled immediately. Please follow these instructions if you encounter any issues: Please wait for a reasonable amount of time to get an OTP on your mobile phone. If the digits are not entered correctly, please ensure they are correct if you have still not received the OTP on your registered mobile number. Additionally, we suggest restarting your phone so that you can try again. The issue may persist, so if you require assistance from our Customer Support team, they\'re glad to be of service.'),
(8, 'What if I wasn\'t able to locate an activation link in my email account?', 'It would be best to wait for a reasonable amount of time until you get a mail from us regarding activation. Although our services are efficient, sometimes issues occur that are out of our control. Be sure to mark our emails as not spam in your spam folder to make sure they are authentic. There is no spamming associated with our services, and we do not encourage anyone to share spam-related materials. You can reach out to our Customer Support team at support@the10score.in if you have not yet received an activation email from us.'),
(9, 'Does email id verification have to be Mandated?', 'The internet isn\'t what it used to be! You don\'t need to verify your email address anymore, but it is necessary to confirm your email address if you want to make a withdrawal.'),
(10, 'How soon do I receive the goodies?', 'I understand you have big plans, that is why it\'ll take almost 14 working days to get your goodies.'),
(11, 'How can I report my complaint or provide any feedback regarding your services?', 'We will be glad to hear from you at support@the10score.in. We would appreciate knowing of any concerns you may have. Our expert will be sure to assist you.'),
(12, 'Would I be able to deactivate my account?', 'We won\'t want you to go. You can send a request to deactivate your account via mail to support@The10Score.in with the subject line \'Requesting to Deactivate Account.');
