(3, 6, 'Rishabh Pant and throwdown specialist', 'https://geekfantasypvtltd.in/10score_admin/public/news_image/Modi Stadium.png', '<p>Rishabh Pant and throwdown specialist Dayananda Garani - two members of the Indian contingent in England - are confirmed to have tested positive for COVID-19.</p>\r\n\r\n<p>As reported earlier by Cricbuzz*, the duo have been isolated. And three more members - Wriddhiman Saha, Abhimanyu Easwaran and Bharat Arun - have also been isolated after being deemed to be close contacts with Garani</p>\r\n\r\n<p>The BCCI, in a statement, confirmed that Pant had tested positive on 8th July and has been isolation since, while Garani tested positive on 14th July. The team had been on a three-week break after the World Test Championship final.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&quot;Pant, who had not stayed in the team hotel during the break period, tested positive on 8th July. He is asymptomatic and currently undergoing self-isolation at the place where he reported positive. He is being closely monitored by the BCCI Medical Team and is on his way to recovery. He will be able to join the squad in Durham after returning two negative RT-PCR tests,&quot; said the statement from BCCI.</p>\r\n\r\n<p>The other four will have to be in a 10-day isolation and are set to stay back in the hotel room in London. &quot;The entire Indian contingent including travelling family members and caretakers were administered with the second dose of covid vaccine earlier this month in London. To mitigate any further risks, the Indian contingent is taking the Lateral Flow Test on a daily basis,&quot; said the BCCI further in its statement.</p>\r\n\r\n<p>The rest of the Indian contingent has left for Durham and are scheduled to assemble there on Thursday afternoon and prepare for a&nbsp;three-day warm-up game&nbsp;against a Select County XI team from July 20.</p>\r\n\r\n<p>COVID-19 cases have been on the rise in the UK of late. The England men&#39;s national team had to undergo quarantine after&nbsp;seven members of the squad&nbsp;tested positive recently. Besides, there was detection of cases in a couple of other counties. Keeping in mind the seriousness of the situation, the Board of Control for Cricket in India (BCCI) secretary Jay Shah recently wrote to the team to exercise caution and avoid going to crowded places.</p>', 0, '10Score Originals', 'Karthik', '2021-07-16 15:07:00', NULL, '2021-07-14 06:41:17'),
(5, 6, 'Captain Mithali Raj sets a new world record by setting the longest-running career in cricket.', 'https://geekfantasypvtltd.in/10score_admin/public/news_image/female.NEWS-1628076229.png', '<p>During her long cricketing career that has lasted more than 22 years, Mithali Raj has collected many inspiring feats as part of her leadership role on the Indian women&#39;s cricket team.</p>\r\n\r\n<p>In fact, what is even more impressive about her accomplishment is that no one else has achieved the same level of achievement in terms of the duration of her career. Fan&#39;s should note that only one member of the men&#39;s cricket team, Sachin Tendulkar, has crossed the milestone of 22 years.</p>\r\n\r\n<p>As of right now, England and India are facing off in a triple-header of one-day internationals and twenty20s. England won the first one-day international by eight wickets, but some lessons and positives were taken away by the Indian team.</p>\r\n\r\n<p>I want to begin by mentioning Mithali Raj, who, in her cricket career, reached a milestone of 22 years. Shafali Verma made her maiden appearance at the ICC in the second match. It did go a bit under the radar a bit. At the age of 17, she has become the youngest woman who has ever played an ODI.</p>\r\n\r\n<p>The 26th of June 1998 marked the debut of Mithali Raj, a native of Hyderabad, who debuted in international cricket. There aren&#39;t many people that can compete with Mithali&#39;s skills. The one cricketer who does have the ability to do that is Sachin Tendulkar.</p>\r\n\r\n<p>He is considered a cricket icon for Indian men&#39;s cricket and a poster boy for several years, and in his ODI career spanning 22 years and 91 days, he played an astounding number of 463 matches.</p>\r\n\r\n<p>Moreover, he holds a record of scoring the highest number of runs in international cricket.</p>\r\n\r\n<p>Over her 22 years and 91-day career, Mithali Raj has represented the Indian national team in 215 ODIs. She also leads a record-breaking number of runs in women&#39;s one-day international cricket.</p>\r\n\r\n<p>Mithali Raj has some pretty good company in its place, which means that she is not alone in her endeavour.</p>', 0, '10Score Orginal', 'Karthik', '2021-08-04 04:26:28', NULL, '2021-07-22 07:02:25'),
(6, 6, 'I have the pleasure and privilege of paying homage to New Zealand\'s cricket team, otherwise known as the \"nice guys\" of the game.', 'https://geekfantasypvtltd.in/10score_admin/public/news_image/male.NEWS-1628076132.png', '<p>While New Zealand are well known for their cricketing heritage before I became aware of them during the 2003 Cricket World Cup, they have only made their mark on me since then. Shane Bond, a handsome and stylish cricketer of the era, known for flashing his fashionable cricket kit in the direction of the umpire, was capable of sending lightning strikes travelling 150 kmph that left even the best of the Australian batsmen scrambling for protection. In this context, we are discussing Australia in the early 2000s. The same group of players similarly scored a mammoth 359 runs against India in the 2003 World Cup final before winning the game with ease.</p>\r\n\r\n<p>Bond couldn&#39;t give a damn about any of that. As he delivered his off-the-bat, some shots sprang from unplayable lengths, while others displayed thunderous pace. Here is what the cop-turned-cricketer did to the star-studded Australian batting line-up when they were interrogated by him and humiliated.</p>\r\n\r\n<p>It is a given that Kiwis are a specific type of people. Their judgment day is not the day they can; they make sure to attack with every bit of strength they can muster. After Bond was done bowling his quota of 10 overs (and in the process, he captured six wickets for just twenty-three runs), the Australians found themselves struggling at 88-7 with 21 overs left to bowl.</p>\r\n\r\n<p>Tweeter 7 cricket.</p>\r\n\r\n<p>It&#39;s not just any team, and it is a legendary team. I&#39;m talking about Australia. Ensure that they are dead before removing the pillow from their head when you are smothering them. In the time since Bond&#39;s quota has been served up, the Aussies have been rebuilding their innings. It was a fantastic performance from Andy Bichel, who scored 83 runs in 64 balls, and in the end, Australia was 208-9 at the end of their innings.</p>\r\n\r\n<p>Upon being challenged, the Australians responded rapidly and in the form of a storm named Brett Lee. A player who has made history as one of the fastest bowlers in the game&#39;s history blasted the Kiwi team away without a trace in a game of cricket. There was a pretty good squad of players for New Zealand, spanning the likes of Stephen Fleming, Daniel Vettori, Scott Styris, Nathan Astle, and one Brendon McCullum, seemingly flying behind the stumps from to time. While the latter was the most talented team globally, the New Zealanders did not possess any giants. It&#39;s as if no one at that moment could be called the best of the best. Like EMPs, they produced incredibly violent bursts of energy that caused a near halt. During the short period the Kiwis sustained, it was not prolonged.</p>\r\n\r\n<p>From Bond and Martin Crowe to the noble Sir Richard Hadley of &#39;The Golden Age,&#39; New Zealand had blessed the past with plenty of incredible talents - a luxury that was reserved for very few and not often. There was a consensus among the New Zealanders that they played with whatever resources they had, committing every bit of their being to every match they played&mdash;frenzied but vulnerable - like a tiger cornered on a branch.</p>\r\n\r\n<p>A bit longer would have allowed Bond to become one of the most successful pacers in cricket history if injuries had not prohibited him. I knew that there was something about New Zealand cricket that made me dislike it so much. Something was always amiss, whether it was something that could have been, would have been, or should have been.</p>\r\n\r\n<p>Brendan McCullum spearheaded the resurgence of New Zealand cricket.</p>\r\n\r\n<p>This change in New Zealand cricket has resulted in a noticeable difference in the quality of play, resulting from these aspects changing throughout the years. McCullum established a sense of aggression within the squad that presumably carried over throughout the contest. Although, he emphasized the true spirit of the game by shunning all negative tactics, one of which they are infamous for on the other side of the Tasman, the rival Australia team. During his tenure as a leader, his team grew into one of the most potent forces in the world.</p>\r\n\r\n<p>When Kane Williamson assumed leadership, New Zealand entirely transformed the business. In cricket, one should pay special attention to the New Zealanders&#39; team, the Williamson, one of the best squads in the modern era, with one of the best batsmen of all time. His calm and peaceful manner might appear opposite McCullum&#39;s, but his fighting spirit&nbsp;<br />\r\nremains unchanged whether his style is more aggressive or more gentle.</p>\r\n\r\n<p>The bowling duo Tim Southee and Trent Boult are some of the most formidable one-two bowling combinations that you will ever see. Since turning pro a few years ago, Tom Latham has consistently been among the best openers of all time. And now, he is fortunate enough to be partnered with Devon Conway, who scored a double century on his Test debut at Lord&#39;s against the English earlier this month. Quite the contrary, Kylie Jamieson, an absolute giant in every sense of the word. The six-foot, six-inch power hitter has an average of 42 with the bat and 14 with the ball. Incorporate the expertise and grit of Ross Taylor into the mix along with the meticulous and dependable Neil Wagner, and you have a solid team that can catch the best players at any given time, regardless of where they are in the world.</p>\r\n\r\n<p>It is now no longer necessary to worry about the imminent extinction of New Zealand&#39;s cricket. These are ruthless creatures of the game, thus making them unstoppable and unavoidable. Nothing is more important than dominating your opponents, and this team will not rest until it achieves its superiority. It took an enormous amount of time for them to be recognized for their true greatness, which was quite an accomplishment. In 2015, the Kiwis were on the brink of winning the 50 Over World Cup, and they came even closer to winning the tournament for a second consecutive year in 2019. However, in both cases, their hopes of glory were dashed.</p>\r\n\r\n<p>Time is marching on, and it&#39;s becoming more and more apparent that the &quot;nice guys&quot; will have their time in the limelight in cricket. When the World Test Championship (WTC) finally ended, it became evident that the New Zealanders were one step ahead of their Indian counterparts most of the time. New Zealand is unquestionably deserving of the right to hold the WTC mace, and there could be no one else who would be more qualified than New Zealand.</p>\r\n\r\n<p>In the latest BARC report, almost 100 million people watched the World Test Championship Final between India and New Zealand. Since 2018, it has been the most viewed Test match in the history of the sport.</p>\r\n\r\n<p>Earlier this month, the World Test Championship (WTC) Finals in which India lost to New Zealand, held between June 18 through 22, captured many Indian cricket enthusiasts around the globe.</p>\r\n\r\n<p>As of 2018, the Indian final was the most-watched Test match in history, based on the Broadcast Audience Research Council of India (BARC). BARC is one of the leading measurement companies for television audiences worldwide.</p>\r\n\r\n<p>There were 99 million people who watched the game on TV during the broadcast, says BARC.</p>\r\n\r\n<p>Viewers should note that the WTC Finals displayed an estimated audience (AMA) of 7,4 million viewers.</p>\r\n\r\n<p>According to BARC, AMA is expressed as the mean number of individuals within a specific target audience who view a particular event on average across minutes.</p>\r\n\r\n<p>Star Sports aired the matches of the WTC Finals and DD Sports, which were the official broadcasting partners of the event.</p>\r\n\r\n<p>In consequence of the deep-dive, the broadcaster anticipated an overwhelmingly positive response from viewers and advertisers alike.</p>\r\n\r\n<p>The last time a world champion was crowned in Test cricket was 144 years ago, and this is why the final of the World Test Championship is considered such a pivotal event in the sport.</p>\r\n\r\n<p>&quot;We expect that the WTC Finals will be the most-watched event in the history of the competition, considering that they will be telecast on both a weekend evening and during prime time - advertisers are essentially gambling on the attention and the pent-up demand for such a show,&quot;&nbsp;</p>\r\n\r\n<p>Star Sports Executive Vice President Anil Jayaraj had previously stated in an interview with MoneyControl.</p>\r\n\r\n<p>An Indian victory, according to experts, would increase the number of viewers. Although India lost the finals of the World Test Championship, it seems there won&#39;t be a significant impact on television viewing.</p>\r\n\r\n<p>It can be argued from what Jayaraj said that the test series between India and England, which took place in India in February and March of this year, is analogous to what Jayaraj said.</p>\r\n\r\n<p>According to him, Team India played an excellent performance in Test cricket, which attracted attention. &quot;On the one hand, they won in Australia, and on the other hand, they beat England in their own country. It was a remarkable performance which led to them receiving the highest viewership for a Test match the last four years due to the India/England series.&quot;</p>\r\n\r\n<p>The final Test match in the series has reached a cumulative audience of nearly 103 million at the global level, with the first Test match in the series has drawn 26 million viewers worldwide.</p>\r\n\r\n<p>Reach measures how many people watched the event for at least&nbsp;<br />\r\na minute to determine how well it reached the target audience.</p>\r\n\r\n<p>Apart from pointing out that test cricket has gained tremendous respect in the last couple of years thanks to top performances and intriguing matches that have recently taken place, Jayaraj had also emphasized what a positive development this sport has experienced.</p>', 0, '10Score Orginal', 'Karthik', '2021-08-04 04:51:43', NULL, '2021-08-04 11:17:28'),
(7, 6, 'I believe that Rahul Dravid\'s appointment as a head coach will contribute to the development of future champions of Indian Cricket in the years to come - VVS Laxman.', 'https://geekfantasypvtltd.in/10score_admin/public/news_image/male.NEWS-1628076304.png', '<p>Rahul Dravid could be the catalyst for creating future champions among Indian cricketers if he takes over as the head coach for the upcoming tour to Sri Lanka - according to the ex-Indian batsman VVS Laxman. With the legendary batsmen watching them closely (Dravid), the Shikhar Dhawan-led young Indian team will play a three-match one-day series against the Islanders, followed by a Twenty20 series the same amount of matches. Having been quarantined for 18 days, the Indian team attended their first training session in Colombo, Sri Lanka.</p>\r\n\r\n<p>&quot;In my opinion, there is no pressure (on David). His role as a coach is to facilitate the development of future champions of the Indian cricket team. The opportunity to play in this series is not necessarily going to be afforded to everyone. While just spending a little time with Rahul and getting his opinion on matters that we may face in the future, something that is already done with many players among the squad will be beneficial in the long run,&quot; Laxman said on Star Sports&#39; CricketConnected.</p>\r\n\r\n<p>It is not surprising that former Indian all-rounder Irfan Pathan said that young cricketers easily understand Dravid due to his straightforward approach.</p>\r\n\r\n<p>&quot;Rahul is just the type of person that communicates clearly, and he brings that with him. When he was the captain of the Indian Cricket Team... at that time, so also now, he was unequivocal with every youngster he met. The question was whether people could go up to him if they had any problem and talk about whatever they pleased,&quot; added Pathan.</p>\r\n\r\n<p>Pathan described an incident during the 2007 World Cup, an event that gave him insight into Dravid&#39;s way of thinking.</p>\r\n\r\n<p>I remember a minor incident from the 2007 World Cup at the West Indies, which I still find peculiar. Mahendra Singh Dhoni was with me when he approached me. &quot;Look, we&#39;re all upset,&quot; he said. Let&#39;s watch a movie.</p>\r\n\r\n<p>&quot;So we watched the movie, and then he came back and said, &#39;yes, we did lose the World Cup&#39;. All of us were striving to make a difference of some kind. Yet this isn&#39;t the end of the world. There is still a lot of life ahead of us. It&#39;s a matter of time before we return&quot;. He is a man of great character, and that is precisely the kind of person he is. The cricketers he works with are always looking to put themselves in positive frames of mind. It means, therefore, that if someone, unfortunate enough, goes out of form in Sri Lanka, if that were to happen, Dravid would be the one to guide the player and give him confidence, he said.</p>\r\n\r\n<p>The first one-day international of the white-ball series between India and Sri Lanka will be played in Colombo on the 13th of July.<br />\r\n&nbsp;</p>', 0, '10Score Orginal', 'Karthik', '2021-08-04 04:54:22', NULL, '2021-08-04 11:20:11'),
(8, 6, '\"The start of the 2021 England-India series will be a time for resting the rotation policy\", says \"Test skipper Joe Root.\"', 'https://geekfantasypvtltd.in/10score_admin/public/news_image/copyright-symbol.png', '<p>Neither Jonny Bairstow nor Mark Wood appeared in the first two Tests against India, but they both appeared in the fourth Test. After this first game of the series, one of the first-choice keepers of the England national team, Jos Buttler, also returned home.</p>\r\n\r\n<p>As the team captain, Joe Root believes it is time for England to move away from the much-debated rotation policy and field the best teams possible against India and in the Ashes series to compete for the World Test Championship (WTC) rather than watching the marquee event on television. As a result of the England and Wales Cricket Board&#39;s (ECB) rotation policy, they were criticized for not going to India with their entire strength squad earlier this year, where they lost 1-2 to miss out on the World Test Championship finals.</p>\r\n\r\n<p>There are five-Test series to be played between India and England beginning on August 4 at Nottingham to commence the second cycle of the World Test Championship (WTC). Root was quoted as saying that, &quot;We are entering a time now where rest and rotation will be left behind us soon,&quot; according to the website ESPNcricinfo.</p>\r\n\r\n<p>&quot;Hopefully, if all our players are in good condition and can play, then we will be able to field the best team for the upcoming match. Quite an exciting prospect and something I am very much looking forward to.&quot; In the first two Tests against India, Jonny Bairstow and Mark Wood did not play. However, they took the field in the fourth Test against India. Jos Buttler, their first-choice keeper after the opening game of the series, has also returned home.</p>\r\n\r\n<p>This time around, Root hopes it will not be the same old story. &quot;Ten tough Test matches are coming up against two brilliant opposition sides. Although we have to take care of business though, it will be a great opportunity for us to play some great cricket, and if everybody is fit and available, we will have a perfect side indeed.&quot;</p>\r\n\r\n<p>Root contends that the tough series against India will be the perfect antepartum preparation for the Ashes, so they should have a full complement of players ready to play in the series. &quot;I would think that we will strive to play our strongest team over the next five Test matches or have our strongest squad available for those matches.&quot; In essence, this is what you do: prepare yourself for this lead-up to the Ashes series and precisely for that series. I want to ensure everyone is at the top of their game for these big games coming up.</p>\r\n\r\n<p>As I watched the World Team Championship final as a spectator, rather than participating in it, it appealed to me to wish that I was involved in something so special. This opportunity has come to us to go a little further and better than we did in our first outing. I expect that we are going to start the season successfully with a strong squad of players to select from.&quot;</p>\r\n\r\n<p>Some former England Cricketers, including Kevin Pietersen, Ian Bell, Michael Vaughan, and many others, made headlines on several occasions when they criticized the ECB for not taking their strongest side to the crucial series against India. The other issue concerned Root was that players were permitted to bring their families to Australia instead of going alone.<br />\r\nECB believes it will mainly depend on Cricket Australia since they must obtain exempted facilities to comply with the law. Eventually, ECB will have to continue with their rotation policy to ensure players have enough time off to spend with their families.</p>\r\n\r\n<p>&quot;I would like for the families to join us in Australia. It is an aspect of that tour that is very important. Considering the amount of cricket that we have in our area, there&#39;s a real need for us to make sure that this is the case. As for the answer, I cannot give you one. Until I know for sure, I can&#39;t tell whether it will be confirmed or not as yet, but I have a lot of hope that it will be.&quot;</p>', 0, '10Score Orginal', 'Karthik', '2021-08-04 04:58:59', NULL, '2021-08-04 11:29:17'),
(9, 6, 'James Anderson the Man', 'https://geekfantasypvtltd.in/10score_admin/public/news_image/male.NEWS-1628077001.png', '<p>As far as seamers go, James Anderson is perhaps one of the best seamers in the history of Test cricket. There is no doubt that the English pacer is the hunter of wickets in the game&#39;s purest form, as he has the most in that format. In the wake of the quartet&#39;s retirement who helped the English regain the Ashes in 2005, James Michael Anderson has carried England&#39;s new-ball attack almost on his shoulders, becoming the first Englishman to reach the mark of 600 wickets. In his England career, James Anderson has seen extraordinary success. Despite being 38 years old, Anderson plays one of the best crickets for the country, defying all odds and displaying his lethal swing bowling to an ever-higher degree.</p>\r\n\r\n<p>Anderson set yet another record during second England versus New Zealand Test at Edgbaston in Birmingham when he took the field. He has now surpassed former teammate Alastair Cook (161) to become the player who has the most Test caps for England. Anderson, who played in his 162nd Test match, has played in 162 Test matches thus far. It would take only four more wickets for him to surpass the legendary Indian spinner Anil Kumble&#39;s tally of 619 wickets, which is another record he holds the potential to break. The pacesetter has already taken 616 Test wickets in his career.</p>\r\n\r\n<p>James Anderson statistics and his illustrious England career</p>\r\n\r\n<p><br />\r\nUp until this point, Anderson has enjoyed a distinguished cricketing career. The veteran appears to have no intention of slowing down. As a result of this performance, the right-arm pacer becomes the first fast bowler to reach 600 Test wickets. There is no doubt that Anderson&#39;s bowling stats are a testament to his outstanding bowling ability. The experienced bowler has bowled several match-winning spells for his country.</p>\r\n\r\n<p>He has taken 616 wickets for England in 162 Test matches in the longer format of the game. During the red ball era of cricket for England, the bowler has taken 30 five-wicket hauls and three ten-wicket hauls. Furthermore, there is a great deal of information available on the England career stats of James Anderson in limited-overs formats in general. During his 194 international matches, he has picked up 269 wickets in ODIs and 19 wickets in T20Is. Moreover, we should not forget Anderson played his last ODI in 2015 and his previous T20I in 2009.</p>\r\n\r\n<p>IPL James Anderson</p>\r\n\r\n<p>There is no doubt about James Anderson&#39;s skills with the red ball, but he has not had the same success with the white ball, which is perhaps why he has not thrived in the Indian Premier League. In addition, Anderson is, for the most part, quite effective in swinging-friendly conditions, which is a thing that is still sadly lacking in India. Consequently, Anderson has not built a reputation for himself in the IPL, despite doing his best.</p>\r\n\r\n<p>Here is a list of 3 things about the man.</p>\r\n\r\n<p>1. For the sake of a name: Many sports figures with a distinguished history and Anderson would undoubtedly be among them. Among the athletes named James Anderson, you will find an Australian tennis player, a golfer from Scotland, a footballer from the United States, an American basketball player, a swimmer from Great Britain competing in the Paralympics and a cricketer. They played for Oxford University in 1955.</p>\r\n\r\n<p>Other notable contributors have included three actors (England, Scotland, and America), one lyricist (English), three authors (one English, two American), a painter (USA), a singer (USA), nine military officers at various levels, nine scientists in multiple fields, a Church of Scotland Minister (Teacher), the list goes on.</p>\r\n\r\n<p>2 Well-versed with both hands: Anderson is not only an excellent left-handed batsman, but he is also a competent left-arm bowler, a spinner to boot, who enjoys playing the left-handed game. During his teens, he used to bowl proper left-arm spin, and he had his first taste of Ian Bell with his left-arm wheel during an exhibition match at Kingsmead. In one of his dreams, he hopes to become a First-Class cricketer with a left-arm spinner.</p>\r\n\r\n<p>3. Not losing sight of the matter: Anderson&#39;s crucial contribution to England&#39;s Ashes win in 2010-11 cannot be understated. A discussion ensued between him and Shane Watson in the first Test at The Gabba. In response, Anderson recalled Michael Atherton&#39;s sage advice. Under such circumstances, the bowler has to return to his bowling mark, which resulted in the batsmen winning the one-up man battle.<br />\r\nThe moment they started staring at each other, Watson stood up, and Anderson stared with a blank expression; Anderson then began to walk back to his bowling mark without interrupting Watson&#39;s gaze. Then, to throw the ball to Alastair Cook, he gestured at him (without breaking eye contact) when he thought he had passed the bowler.</p>\r\n\r\n<p><br />\r\nKarthik is the Editor-in-Chief at 10 Score</p>', 0, '10Score Orginal', 'Karthik', '2021-08-04 05:06:42', NULL, '2021-08-04 11:36:41');
